import {ThemeProvider} from '@material-ui/core/styles'
import theme from '../temaConfig'


import firebase from "firebase";
import "firebase/auth";
import {
  FirebaseAuthProvider,
  FirebaseAuthConsumer,
  IfFirebaseAuthed,
  IfFirebaseAuthedAnd
} from "@react-firebase/auth";
import { config } from "../config";

import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';

import Paper from '@material-ui/core/Paper';

import Button from 'react-bootstrap/Button';

import Form from 'react-bootstrap/Form';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';






const Logueando =() => {

 


  return (

  <ThemeProvider theme={theme}>

   <FirebaseAuthProvider {...config} firebase={firebase}>


       <AppBar position="static" style={{backgroundColor:'#3f51b5', width:'100%'}}>
        <Toolbar variant="dense">
         
          <Typography variant="h6" color="inherit">
            <p id="logoTxtFlepxii">Flepxii</p>
          </Typography>

        </Toolbar>
      </AppBar>


              <div style={{display:'flex', flexDirection:'row', alignItems:'center', justifyContent:'space-around', backgroundColor:'#42a5f5'}}>

                    <div style={{marginTop:'-70px'}}>

                    <div style={{marginTop:'0px', width:'100%', display:'flex', flexDirection:'column', alignItems:'center'}}>
                    <p style={{ fontFamily:'Roboto, sans-serif', fontSize:'20px', color:'white'}}>Bienvenido a Flepxii inicia sesion para acceder a nuestra version beta 1.0</p>
                    </div>
                
                    <Paper elevation={3} style={{marginTop:'40px', height:'300px', width:'300px', backgroundColor:'#eeeded'}} className="container"> 


                        

                      <div style={{display:'Flex', flexDirection:'column', alignItems:'center'}}>

                      <Button
                        style={{marginTop:'80px', backgroundColor:'#3f51b5', color:'white'}}
                        variant="contained"
                        onClick={() => {
                          const googleAuthProvider = new firebase.auth.GoogleAuthProvider();
                          firebase.auth().signInWithPopup(googleAuthProvider);
                        }}
                      >
                        Iniciar Sesion con Google
                      </Button>

                      <br/>

                      {/*<Button
                        variant="outline-primary"
                      >
                        Iniciar Sesion con Facebook
                      </Button> */} 

                      </div>

                      <br/>

                      {/*<Form>
                        <Form.Group controlId="formBasicEmail">
                        
                        <Form.Control type="email" placeholder="E-mail" />
                        <Form.Text className="text-muted">
                            We'll never share your email with anyone else.
                        </Form.Text>
                        </Form.Group>

                        <Form.Group controlId="formBasicPassword">
                        
                        <Form.Control type="password" placeholder="Contraseña" />
                        </Form.Group>
                        <Form.Group controlId="formBasicCheckbox">
                        <Form.Check type="checkbox" label="Check me out" />
                        </Form.Group>
                        
                        <Button variant="primary" size="lg" block type="submit">
                            Iniciar Sesion
                        </Button>

                        <br/>

                        <div id="ctnAvisoLogin">
                        <h6>Aun no tienes cuenta en Flepxii?</h6>
                      </div>

                        

                        <Button variant="outline-dark" size="lg" block type="submit">
                            Registrate
                        </Button>
                      </Form>*/}


                      </Paper>

                      </div>


                      <div>
                      <img  src="https://image.freepik.com/vector-gratis/ilustracion-teletrabajo_23-2148485455.jpg" style={{width:'600px'}}/>
                      </div>

              </div>
    

        <FirebaseAuthConsumer>
          {({ isSignedIn, user, providerId }) => {
            
            
            //return (
              //<div>
              //<pre style={{ height: 300, overflow: "auto" }}>
                //{JSON.stringify({ isSignedIn, user, providerId }, null, 2)}
              //</pre>
              
              //</div>
           // );
          }}
        </FirebaseAuthConsumer>


        
        


          <IfFirebaseAuthedAnd
            filter={({ providerId }) => providerId !== "anonymous"}
          >
            {({ providerId }) => {
              return <div>You are authenticated with {providerId}</div>;
            }}
          </IfFirebaseAuthedAnd>


          

          
            
      
   </FirebaseAuthProvider>  

    </ThemeProvider>
    
  );
}

export default Logueando;
